import React from "react";

export default class Login extends React.Component {
  state = {
    username: "",
    password: "",
    role: "",
  };
  render() {
    return (
      <div>
          <div></div>
        Username:
        <input
          name="username"
          onChange={(event) => {
            this.setState({ username: event.target.value });
          }}
        />
        <br />
        <br />
        Password:
        <input
          name="password"
          onChange={(event) => {
            this.setState({ password: event.target.value });
          }}
        />
        <br />
        <br />
        Role:
        <input
          name="role"
          onChange={(event) => {
            this.setState({ role: event.target.value });
          }}
        />
      </div>
    );
  }
}
